-- Schemas ---------------------------------------------------------------------
DROP SCHEMA IF EXISTS Prot CASCADE;
CREATE SCHEMA Prot;

-- Stamtabellen ----------------------------------------------------------------

-- Actual tabellen--------------------------------------------------------------

CREATE SEQUENCE Prot.seq_Levsaantek START WITH 1;
CREATE TABLE Prot.Levsaantek (
   ID                            BigInt                        GENERATED BY DEFAULT AS SEQUENCE Prot.seq_Levsaantek  NOT NULL,
   ToegangLevsautorisatie        Integer                       NOT NULL,
   Dienst                        Integer                       NOT NULL,
   TsKlaarzettenLev              Timestamp with time zone      NOT NULL,
   DatMaterieelSelectie          Integer                       ,
   DatAanvMaterielePeriodeRes    Integer                       ,
   DatEindeMaterielePeriodeRes   Integer                       ,
   TsAanvFormelePeriodeRes       Timestamp with time zone      ,
   TsEindeFormelePeriodeRes      Timestamp with time zone      NOT NULL,
   AdmHnd                        BigInt                        ,
   SrtSynchronisatie             Smallint                      ,
   CONSTRAINT pk_Levsaantek PRIMARY KEY (ID)
);

CREATE SEQUENCE Prot.seq_LevsaantekPers START WITH 1;
CREATE TABLE Prot.LevsaantekPers (
   ID                            BigInt                        GENERATED BY DEFAULT AS SEQUENCE Prot.seq_LevsaantekPers  NOT NULL,
   Levsaantek                    BigInt                        NOT NULL,
   Pers                          Integer                       NOT NULL,
   CONSTRAINT pk_LevsaantekPers PRIMARY KEY (ID),
   CONSTRAINT uc_LevsaantekPers_Levsaantek_Pers UNIQUE (Levsaantek, Pers)
);

-- Materiele historie tabellen -------------------------------------------------

-- Foreign keys ----------------------------------------------------------------
ALTER TABLE Prot.LevsaantekPers ADD CONSTRAINT fk_LevsaantekPers_Levsaantek_Levsaantek FOREIGN KEY (Levsaantek) REFERENCES Prot.Levsaantek (ID);

