INSERT INTO Kern.SrtDoc (ID, Naam, Oms, Rangorde) VALUES (5, 'Akte van partnerschapsregistratie', 'Akte van registratie van een partnerschap, opgenomen in de registers van de burgerlijke stand in Nederland, zoals bedoeld in artikel 2.8 lid 1 sub a, dan wel artikel 2.8 lid 2 sub a', 1);
INSERT INTO Kern.SrtDoc (ID, Naam, Oms, Rangorde) VALUES (6, 'Akte van beëindiging partnerschapsregistratie', 'Akte van beëindiging van het in het buitenland aangegaan geregistreerd partnerschap, opgenomen in de registers van de burgerlijke stand in Nederland, zoals bedoeld in artikel 2.8 lid 1 sub a', 1);
INSERT INTO Kern.SrtDoc (ID, Naam, Oms, Rangorde) VALUES (7, 'Akte van erkenning ongeboren vrucht', 'Akte van erkenning van elk kind waarvan een vrouw zwanger is opgemaakt door de ambtenaar van de burgerlijke stand, zoals bedoeld in artikel 2.8 lid 1 sub b', 2);
