INSERT INTO Kern.SrtDoc (ID, Naam, Oms, Rangorde) VALUES (11, 'Koninklijk besluit', 'Koninklijk besluit over in Nederland voorgedane feiten, zoals bedoeld in artikel 2.8 lid 1 sub b', 2);
INSERT INTO Kern.SrtDoc (ID, Naam, Oms, Rangorde) VALUES (12, 'Besluit overig', 'Besluit over in Nederland voorgedane feiten, zoals bedoeld in artikel 2.8 lid 1 sub b, niet zijnde een koninklijk besluit.', 2);
INSERT INTO Kern.SrtDoc (ID, Naam, Oms, Rangorde) VALUES (13, 'Nederlandse rechterlijke uitspraak', 'Een in kracht van gewijsde gegane rechterlijke uitspraak over feiten die zich hebben voorgedaan in Nederland en/of waarvan de rechterlijke uitspraak gedaan is in Nederland, zoals bedoeld in artikel 2.8 lid 1 sub b en artikel 2.8 lid 2 sub b', 2);
INSERT INTO Kern.SrtDoc (ID, Naam, Oms, Rangorde) VALUES (14, 'Notariële akte', 'Notariële akte zoals bedoeld in artikel 2.8 lid 1 sub b', 2);
INSERT INTO Kern.SrtDoc (ID, Naam, Oms, Rangorde) VALUES (15, 'Consulaire akte (rechtsfeit in NL)', 'Een door een in Nederland geaccrediteerde consulaire ambtenaar van een ander land bevoegd opgemaakte akte die ten doel heeft een in Nederland voorgedaan feit te bewijzen, zoals bedoeld in artikel 2.8 lid 3', NULL);
INSERT INTO Kern.SrtDoc (ID, Naam, Oms, Rangorde) VALUES (16, 'Buitenlandse akte', 'Een buiten Nederland overeenkomstig de plaatselijke voorschriften door een bevoegde instantie opgemaakte akte die ten doel heeft tot bewijs te dienen van het desbetreffende feit, zoals bedoeld in artikel 2.8 lid 2 sub c', 2);
INSERT INTO Kern.SrtDoc (ID, Naam, Oms, Rangorde) VALUES (17, 'Buitenlandse rechterlijke uitspraak', 'Een uitspraak door een niet-Nederlandse rechter over buiten Nederland voorgedane feiten, zoals bedoeld in artikel 2.8 lid 2 sub c', 2);
INSERT INTO Kern.SrtDoc (ID, Naam, Oms, Rangorde) VALUES (18, 'Akte van bekendheid/beëdigde verklaring (1:45 BW)', 'Een akte van bekendheid of beëdigde verklaring volgens artikel 1:45 Burgerlijk wetboek, zoals bedoeld in artikel 2.8 lid 2 sub c', 3);
INSERT INTO Kern.SrtDoc (ID, Naam, Oms, Rangorde) VALUES (19, 'Buitenlands geschrift', 'Een geschrift - inclusief PIVA PL - dat in het buitenland overeenkomstig de laatselijkevoorschriften is opgemaakt door een bevoegde instantie, waarin het zich desbetreffende feit is vermeld, zoals bedoeld in artikel 2.8 lid 2 sub d', 4);
INSERT INTO Kern.SrtDoc (ID, Naam, Oms, Rangorde) VALUES (20, 'Verklaring onder eed of belofte', 'Een verklaring onder eed of belofte over in een ander land voorgedane feiten gedaan ten overstaan van een door College B&W aangestelde ambtenaar, zoals bedoeld in artikel 2.8 lid 2 sub e', 5);
