INSERT INTO Kern.SrtElementAutorisatie (ID, Naam, Oms) VALUES (1, 'Via groepsautorisatie', 'Het attribuut kan niet direct geautoriseerd worden maar wordt geleverd als de groepsautorisatie aanwezig is. B.v. tijdstip verval van een groep wordt alleen geleverd als de partij geautoriseerd is om formele historie te zien voor de groep.');
INSERT INTO Kern.SrtElementAutorisatie (ID, Naam, Oms) VALUES (2, 'Niet verstrekken', 'Een afnemer mag dit attribuut op grond van H3 wet BRP niet verstrekt krijgen. Het attribuut kan mogelijk wel op grond van andere wetgeving geleverd worden.');
