INSERT INTO Kern.SrtElementAutorisatie (ID, Naam, Oms) VALUES (5, 'Verplicht', 'Een afnemer moet voor dit attribuut geautoriseerd worden volgens de wet BRP (o.a. artikel 3.10).');
INSERT INTO Kern.SrtElementAutorisatie (ID, Naam, Oms) VALUES (6, 'Aanbevolen', 'Een afnemer zou bij voorkeur een autorisatie voor dit attribuut moeten krijgen. Er is echter geen wettelijke grondslag.');
